import React from 'react';
import {submitCampaign} from '../../Services/member-services';

export default class Members extends React.Component{
    constructor(){
        super();
        this.state={
           members:[]
        }
    }
    componentDidMount(){
      this.fetchSubmitCampaign();
    }

    fetchSubmitCampaign(){
        submitCampaign()
        .then(response => response.json())
        .then(data =>{
            if(data){
               this.setState({
                   members: data.members
               })
            }
        })
        .catch(error =>{
            console.log("ERROR");
        })
    }

    render(){
        return(
            <main>
                <table>
                    <thead>
                        <tr>
                            <th>Members ID</th>
                            <th>Members Name</th>
                            <th>Members Location</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            {this.state.members && this.state.members.length>0}
                            <td>HIIvbskhddf</td>

                        </tr>
                    </tbody>
                    <tfoot>
                        <tr>
                            <th>HII</th>
                        </tr> 
                    </tfoot>
                </table>
            </main>
        );
    }
}
